import React, { useMemo, useState, useEffect } from 'react';
import { useReactTable, getCoreRowModel, flexRender } from '@tanstack/react-table';
import {
    getPositions,
    getTechniqueTypes,
    addCustomField,
    deleteCustomField,
    getTechniques,
    deleteTechnique
} from '../services/api';

const TechniqueTable = ({ updateTechnique }) => {
    const [techniquesState, setTechniquesState] = useState([]);
    const [positions, setPositions] = useState([]);
    const [techniqueTypes, setTechniqueTypes] = useState([]);
    const [showModal, setShowModal] = useState(false);
    const [showDeleteModal, setShowDeleteModal] = useState(false);
    const [showDeleteTechniqueModal, setShowDeleteTechniqueModal] = useState(false);
    const [newFieldType, setNewFieldType] = useState('');
    const [newFieldName, setNewFieldName] = useState('');
    const [fieldToDelete, setFieldToDelete] = useState(null);
    const [techniqueToDelete, setTechniqueToDelete] = useState(null);

    useEffect(() => {
        const fetchTechniques = async () => {
            try {
                const data = await getTechniques();
                setTechniquesState(data);
            } catch (error) {
                console.error('Error al obtener t√©cnicas:', error);
            }
        };

        const fetchPositions = async () => {
            try {
                const data = await getPositions();
                setPositions(data);
            } catch (error) {
                console.error('Error al obtener posiciones:', error);
            }
        };

        const fetchTechniqueTypes = async () => {
            try {
                const data = await getTechniqueTypes();
                setTechniqueTypes(data);
            } catch (error) {
                console.error('Error al obtener tipos de t√©cnica:', error);
            }
        };

        fetchTechniques();
        fetchPositions();
        fetchTechniqueTypes();
    }, []);

    const getPositionName = (id) => {
        const position = positions.find((pos) => pos._id === id);
        return position ? position.name : 'Sin posici√≥n';
    };

    const getTechniqueTypeName = (idArray) => {
        const names = idArray
            .map((id) => {
                const type = techniqueTypes.find((t) => t._id === id);
                return type ? type.name : 'Sin tipo';
            })
            .join(', ');
        return names;
    };

    const columns = useMemo(() => {
        const baseColumns = [
            { id: 'name', accessorKey: 'name', header: 'Nombre' },
            {
                id: 'techniqueType',
                accessorKey: 'techniqueType',
                header: 'Tipo',
                cell: ({ getValue }) => getTechniqueTypeName(getValue()),
            },
            {
                id: 'positionStart',
                accessorKey: 'positionStart',
                header: 'Posici√≥n Inicial',
                cell: ({ getValue }) => getPositionName(getValue()),
            },
            {
                id: 'endPosition',
                accessorKey: 'endPosition',
                header: 'Posici√≥n Final',
                cell: ({ getValue }) => getPositionName(getValue()),
            },
            { id: 'proficiencyLevel', accessorKey: 'proficiencyLevel', header: 'Proficiency Level' },
            { id: 'giNoGi', accessorKey: 'giNoGi', header: 'Gi/No Gi' },
            {
                id: 'actions',
                header: 'Acciones',
                cell: ({ row }) => (
                    <>
                        <button onClick={() => handleDeleteTechniqueClick(row.original._id)} style={styles.deleteButton}>
                            Eliminar
                        </button>
                    </>
                ),
            },
        ];

        const customFieldColumns = [];
        if (techniquesState.length > 0 && Array.isArray(techniquesState[0].customFields)) {
            techniquesState[0].customFields.forEach((customField) => {
                // Verifica que customField y sus propiedades existen
                if (customField && customField.field && customField.field._id) {
                    customFieldColumns.push({
                        id: customField.field._id,
                        accessorKey: `customFields.${customField.field._id}`,
                        header: (
                            <div>
                                {customField.field.name}
                                <button onClick={() => handleDeleteFieldClick(customField.field._id)} style={styles.deleteFieldButton}>üóëÔ∏è</button>
                            </div>
                        ),
                        cell: ({ getValue }) => getValue() || 'N/A',
                    });
                }
            });
        }


        return [
            ...baseColumns,
            ...customFieldColumns,
            {
                id: 'addNewField',
                header: (
                    <button onClick={() => setShowModal(true)} style={styles.addNewFieldButton}>
                        Add New Field
                    </button>
                ),
                cell: () => null,
            },
        ];
    }, [positions, techniqueTypes, techniquesState]);

    const table = useReactTable({
        data: techniquesState,
        columns,
        getCoreRowModel: getCoreRowModel(),
    });

    const handleAddNewField = async () => {
        try {
            await addCustomField(newFieldName, newFieldType);
            setShowModal(false);
            setNewFieldName('');
            setNewFieldType('');
            const updatedTechniques = await getTechniques();
            setTechniquesState(updatedTechniques);
        } catch (error) {
            if (error.response && error.response.status === 400) {
                console.error('Error al agregar campo personalizado: Este nombre ya existe.');
                alert('El nombre del campo personalizado ya existe. Por favor elige otro.');
            } else {
                console.error('Error al agregar nuevo campo:', error);
            }
        }
    };


    const handleDeleteFieldClick = (field) => {
        setFieldToDelete(field);
        setShowDeleteModal(true);
    };

    const handleConfirmDeleteField = async () => {
        if (!fieldToDelete) {
            console.error("Error: fieldToDelete est√° vac√≠o o no definido.");
            return;
        }

        try {
            await deleteCustomField(fieldToDelete);
            setShowDeleteModal(false);
            setFieldToDelete(null);
            const updatedTechniques = await getTechniques();
            setTechniquesState(updatedTechniques);
        } catch (error) {
            console.error('Error al eliminar campo personalizado:', error);
        }
    };

    const handleDeleteTechniqueClick = (techniqueId) => {
        setTechniqueToDelete(techniqueId);
        setShowDeleteTechniqueModal(true);
    };

    const handleConfirmDeleteTechnique = async () => {
        try {
            await deleteTechnique(techniqueToDelete);
            setShowDeleteTechniqueModal(false);
            setTechniqueToDelete(null);
            setTechniquesState((prevTechniques) =>
                prevTechniques.filter((technique) => technique._id !== techniqueToDelete)
            );
        } catch (error) {
            console.error('Error al eliminar t√©cnica:', error);
        }
    };

    return (
        <div>
            <h1>Techniques</h1>
            <table style={styles.table}>
                <thead>
                    {table.getHeaderGroups().map((headerGroup) => (
                        <tr key={headerGroup.id}>
                            {headerGroup.headers.map((header) => (
                                <th key={header.id} style={styles.cell}>
                                    {flexRender(header.column.columnDef.header, header.getContext())}
                                </th>
                            ))}
                        </tr>
                    ))}
                </thead>
                <tbody>
                    {table.getRowModel().rows.map((row) => (
                        <tr key={row.id}>
                            {row.getVisibleCells().map((cell) => (
                                <td key={cell.id} style={styles.cell}>
                                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                                </td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>

            {showModal && (
                <div style={styles.modalOverlay}>
                    <div style={styles.modal}>
                        <h2>Agregar nuevo campo</h2>
                        <input
                            type="text"
                            placeholder="Nombre del campo"
                            value={newFieldName}
